import React from 'react';

const Products = ({object, product}) => {
    console.log(product);
    return (
    <div className='col-md-4'>
     <div className="card" style={{width: '18rem'}}>
        <img style={{height: '300px'}} src={object.product.imageURL} alt=""/>
       <div className="card-body">
          <h3 class="card-title">{object.product.name} - {object.product.weight}</h3>
          <h4 class="card-text">Price: ${object.product.price} </h4>
         <button href="#" class="btn btn-outline-success"> Buy Now</button>
        <button class="btn btn-outline-danger"> Delete</button>
       </div>
     </div>
    </div>
    );
};

export default Products;
